import React from "react";
import "./error.css";
const Error = () => {
  return (
    <div className="error_page">
      <div className="error_text">
        <p>OOPS! PAGE NOT FOUNT</p>
        <h1>404</h1>
        <p>WE ARE SORRY</p>
      </div>
    </div>
  );
};

export default Error;
